            for(c=0;c<3;++c)
              norma_high_even+=exp(buffer_out[c]);

            // Prepares for next layer 
            for (c = 0; c < 3; ++c )
              buffer_in[c] = activation_high_even_10(buffer_out[c], norma_high_even);


            

      //i = 0;
      //for (c = 0; c < 3; ++c)
      //  if (buffer_in[c] > buffer_in[i])
      //    i = c;
      
      if (flag==0) //vbf
        return buffer_in[0];
      else if (flag==1) //ggh
        return buffer_in[1];
      else if (flag==2)  //bkg
        return buffer_in[2];
   
      
